import React from 'react';
import numeral from "numeral";
import './Table.css';

function Table({countries}) {
    return(
        <div className="table">
        {countries.map((country) => (
     <tr>
         <td>{country}</td>
         <td>
             <strong>{numeral(country.cases).format("")}</strong>
         </td>
     </tr>
        ))}
    </div>
    );
    
    }

export default Table;
